/**
 * 
 * Server-side module bundler
 * with gulp.js, webpack
 * 
 * by chiggang.2019
 * 
 */

/*
 *  
 *
 * 1.      
 * 2.  node.js     , /server  (, node_modules  )
 * 3.  node.js  dependencies  package.json 
 * 4. yarn   dependencies node module 
 * 5. gulp   (gulp css:css   gulp.task     )
 * 6. /app/server.js   
 * 7.          (    )
 * 8.   *.js   (, node_modules  )
 * 9.   /app/server.js  
 * 10. node server     
 */

import gulp from 'gulp';
import { PATH } from './path.config';
import del from 'del';
import fs from 'fs';
import fileCache from 'gulp-file-cache';
import sass from 'gulp-sass';
import cleanCSS from 'gulp-clean-css';
import webpack from 'webpack';
import webpackStream from 'webpack-stream';
import webpackConfig from './webpack.config';

const cache = new fileCache();

// sass  
gulp.task('css:sass', () => {
  console.log('sass');

  return new Promise(resolve => {
    gulp.src(PATH.SRC.SCSS)
      .pipe(cache.filter())
      .pipe(sass())
      .pipe(cache.cache())
      .pipe(gulp.dest(PATH.DEST.CSS));

    resolve();
  });
});

// css  
gulp.task('css:css', () => {
  console.log('css');

  return new Promise(resolve => {
    gulp.src(PATH.SRC.CSS)
      .pipe(cache.filter())
      .pipe(cleanCSS({
        compatibility: 'ie8'
      }))
      .pipe(cache.cache())
      .pipe(gulp.dest(PATH.DEST.CSS));

    resolve();
  });
});






