const css = gulp.series('css:sass', 'css:css');
const server = gulp.series('js:server');
const js2 = gulp.series('js:js');

//     
let clean = () => {
  console.log('Delete');

  return new Promise(resolve => {
    del.sync(PATH.DIR.HTML_DEST);
    del.sync(PATH.DIR.SERVER_DEST);

    resolve();
  });
};

