// SRC:  html, css, js   
// DEST:    
// SRC:  html, css, js   
// DEST:    
const DIR = {
  HTML: 'html',
  HTML_DEST: 'html_dest',
  SERVER: 'server',
  SERVER_DEST: 'server_dest',
};

// PATH.SRC:  
// PATH.DEST:  
module.exports = {
  PATH: {
    DIR: DIR,
    SRC: {
      HTML: `${DIR.HTML}/**/*.html`,
      CSS: `${DIR.HTML}/css/*.css`,
      SCSS: `${DIR.HTML}/scss/**/*.scss`,
      JS: `${DIR.HTML}/js/**/*.js`,
      SERVER: `${DIR.SERVER}/**/*.js`,
    },
    DEST: {
      HTML: `${DIR.HTML_DEST}/`,
      CSS: `${DIR.HTML_DEST}/css`,
      JS: `${DIR.HTML_DEST}/js`,
      SERVER: `${DIR.SERVER_DEST}`,
    },
  },
};

